import React from "react";
import "./Signup.css";

function Mignup() {
  return (
    <div>
      <div className="loginPage">
        <div className="organize">
          <p className="loginString">sdasda in</p>
        </div>
        <div className="inputLogin">
          <input type="email" className="firstInput" placeholder="firstName" />
          <input
            type="password"className="secondInput"placeholder="secondeName"/>
          <input type="password" className="secondInput" placeholder="email" />
          <input type="password" className="secondInput"placeholder="enterYourPassword"/>
        </div>

        <div className="enterToLogIin">
          <h1 className="enterToLogIinString">Log in</h1>
          <a className="signInString">sign in</a>
        </div>
      </div>
    </div>
  );
}

export default Mignup;
